import styled from 'styled-components/native'
import * as BaseStyles from '../BaseStyles.js'

export const BackgroundDiv = styled(BaseStyles.Container)`
    background: #A3CDED
    box-sizing: border-box;
    height: 100%;
    width: 100%;
    position: relative;
    z-index: 0;
`
